'use client';
import createComponent from '../utils/createComponent';
/**
 * HeadingGroup is a group of headings.
 * @see https://rsuitejs.com/components/heading
 */
var HeadingGroup = createComponent({
  name: 'HeadingGroup',
  componentAs: 'hgroup'
});
export default HeadingGroup;
